package br.com.elvisassis.msavaliadorcredito.infra.clients;import br.com.elvisassis.msavaliadorcredito.domain.model.Card;import br.com.elvisassis.msavaliadorcredito.domain.model.ClientCard;import org.springframework.cloud.openfeign.FeignClient;import org.springframework.http.ResponseEntity;import org.springframework.web.bind.annotation.GetMapping;import org.springframework.web.bind.annotation.PathVariable;import org.springframework.web.bind.annotation.RequestParam;import java.math.BigDecimal;import java.util.List;@FeignClient(name = "mscartoes" , path = "/cartoes")public interface CardResourceClient {    @GetMapping(params = "cpf")    ResponseEntity<List<ClientCard>> getCardsByClients(@RequestParam("cpf") String cpf);    @GetMapping(value = "/{income}")ResponseEntity<List<Card>> getCardByIncome(@PathVariable("income") Long income);}